void  play_sound_callback(WEPAppData *pWep)
{
#ifdef WEP_DEBUG
	WEP_DebugPrint("************play_sound_callback !!! ****************");
#endif
		DEV_TimerStop(pWep->pDeviceData, TIMER_RECORD_PROMPT);
		pWep->bPlaySound = FALSE;	
		pWep->bRecordSound = FALSE;
		pWep->bDeActiveWin = FALSE;
		pWep->recordStatus = RECORD_STATUS_IDLE;
		DEV_MemSet(pWep->playSoundBuf, 0x00, MAX_RECORD_BUFFER_LEN);
		pWep->playSoundBufLen = 0;
		pWep->pILUI->UIShow(pWep->pILUI,TRUE);

}
void  record_prompt_screen(WEPAppData *pWep)
{
	UI * pUI = (UI *)(pWep->pIUI);
	
	int32_t rec_x, rec_y, rec_w, rec_h;
	int32_t text_x, text_y, text_w, text_h;
	byte_t * pSZ;
	UI_character_type msgBuf[32];

	DeviceData * pDd = (DeviceData *)(pUI->pWep->pDeviceData);
	
	if (GetActiveScreenId() != pDd->screenId)
	{
		return;
	}

	{
		#ifdef WEP_DEBUG
			WM_DebugPrint("************ record_prompt_screen pWep->recordStatus:%d****************",pWep->recordStatus);
		#endif	
	//	WepCamStop();
	}
	
	if (pWep->recordStatus == RECORD_STATUS_IDLE)
		return;	
	clear_key_handlers();
#if defined(__MMI_TOUCH_SCREEN__)
	wgui_clear_pen_handlers();
	mmi_pen_editor_exit_screen();
	mmi_pen_editor_close_input_box();
#endif

	
	SetKeyHandler(WEP_Exit_Message, KEY_END, KEY_EVENT_DOWN);
	
	text_x = 0;
	text_y = 0;
	
	rec_x = 0;//(UI_device_width)/8;//BN10036
	rec_y = (UI_device_height)/2;
	rec_w = UI_device_width;//UI_device_width - 2* rec_x; //BN10036
	rec_h = (UI_device_height)/3;
	
	gui_lock_double_buffer();

	gui_draw_gradient_rounded_rectangle(rec_x, rec_y, rec_x+rec_w, rec_y+rec_h, gui_color(0, 0, 0), gui_color(255, 255, 255), 3);
	gui_set_font(&MMI_default_font);
	gui_set_text_color(gui_color(0,0,0));
	
	if (pWep->recordStatus == RECORD_STATUS_RECORDING)
	{
		if (pWep->bRecordSound)
		{
			UI_character_type buffer[3];
			pSZ = GETSTRRES(SZ_RECORD_PROMPT, pWep->languageId);
			DEV_NetUniByte2LocStr(msgBuf, pSZ, UTL_UniStrLen(pSZ));
			gui_measure_string((UI_string_type)msgBuf, &text_w, &text_h);
			gui_move_text_cursor(rec_x + (rec_w - text_w)/2 , rec_y + (rec_h - text_h)/2);
  			gui_print_text((UI_string_type)msgBuf);
			text_x = rec_x + rec_w/2;
			text_y = rec_y + (rec_h + text_h)/2 + 6;
			buffer[0] =  0x0000 | (pWep->secondCounts + 0x30);
			if (pWep->languageId)
				buffer[1] =  0x79d2; //秒//BN10036
			else
				buffer[1] = 0x0053;//S
			buffer[2] =  0x0000;
			gui_move_text_cursor(text_x , text_y);
			gui_print_text((UI_string_type)buffer);
		}

	}
	else if (pWep->recordStatus == RECORD_STATUS_SEND_FINISH)
	{
		pSZ = GETSTRRES(SZ_RECORD_SEND_PROMPT, pWep->languageId);
		DEV_NetUniByte2LocStr(msgBuf, pSZ, UTL_UniStrLen(pSZ));
		gui_measure_string((UI_string_type)msgBuf, &text_w, &text_h);
		gui_move_text_cursor(rec_x + (rec_w - text_w)/2 , rec_y + (rec_h - text_h)/2);
  		gui_print_text((UI_string_type)msgBuf);
	}
	else if (pWep->recordStatus == RECORD_STATUS_PLAYING)
	{
		pSZ = GETSTRRES(SZ_RECORD_PLAY_PROMPT, pWep->languageId);
		DEV_NetUniByte2LocStr(msgBuf, pSZ, UTL_UniStrLen(pSZ));
		gui_measure_string((UI_string_type)msgBuf, &text_w, &text_h);
		gui_move_text_cursor(rec_x + (rec_w - text_w)/2 , rec_y + (rec_h - text_h)/2);
  		gui_print_text((UI_string_type)msgBuf);
	}
	else if (pWep->recordStatus == RECORD_STATUS_SENDING)
	{
		pSZ = GETSTRRES(SZ_RECORD_DATA_SENDING, pWep->languageId);
		DEV_NetUniByte2LocStr(msgBuf, pSZ, UTL_UniStrLen(pSZ));
		gui_measure_string((UI_string_type)msgBuf, &text_w, &text_h);
		gui_move_text_cursor(rec_x + (rec_w - text_w)/2 , rec_y + (rec_h - text_h)/2);
  		gui_print_text((UI_string_type)msgBuf);

	}
	gui_unlock_double_buffer();
	gui_BLT_double_buffer(rec_x, rec_y, rec_x + rec_w, rec_y + rec_h);
	
	if (pWep->recordStatus == RECORD_STATUS_RECORDING )
	{
		if (pWep->secondCounts >0)
		{   
			SetKeyHandler(end_record_voice,   KEY_ENTER, KEY_EVENT_UP);
		#if defined(__MMI_TOUCH_SCREEN__) //BN10046
			mmi_pen_register_up_handler(CSD_mmi_wgui_general_pen_up_hdlr);//BN
		#endif
			pWep->secondCounts--;
			DEV_TimerStop(pWep->pDeviceData, TIMER_RECORD_PROMPT);
			DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, 1000, 
						(PFNTIMERCALLBACK)record_prompt_screen, pWep);
		}
		else
		{
#ifdef WEP_DEBUG
			WM_DebugPrint("************ 10 time up to end_record_voice ****************");
#endif		
			end_record_voice();
		}
	}
	
}
