static bool_t  UI_SoundDataProcess(IBuilder * pIBuilder, byte_t buffer[], int32_t len)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
	WEPAppData * pWep = pBuilder->pWep;
	DeviceData * pDd = (DeviceData *)(pUI->pWep->pDeviceData);
	
#ifdef WEP_DEBUG
	WEP_DebugPrint(">>>> SoundDataProcess : sound size =%d",len);
#endif

	if (len <= 0 || !pWep->bInVideoChat)
	{
		return FALSE;
	}

	if (pWep->bPlaySound && pWep->recordStatus == RECORD_STATUS_PLAYING)
	{
		return FALSE;
	}
	{
	//	WepCamStop(); 
	//	mdi_audio_play_string(pWep->playSoundBuf, pWep->playSoundBufLen -2, MDI_FORMAT_AMR, DEVICE_AUDIO_PLAY_ONCE, NULL,record_play_callback);		
	//	return TRUE;
	} 
	if (pWep->bOpenFullEditor)
	{
		return FALSE;
	}
#ifdef WEP_DEBUG
	WEP_DebugPrint(">>>>>>>>>>>> receive sound data <<<<<<<<<<<<<<<<<<<<<<");
#endif

	if (buffer[2] == 'A' && buffer[3] == 'M' && buffer[4] == 'R')
	{
		//amr文件文件头标识
		DEV_MemSet(pWep->playSoundBuf, 0x00, MAX_RECORD_BUFFER_LEN);
		pWep->playSoundBufLen = 0;
	}

	DEV_MemCpy(pWep->playSoundBuf + pWep->playSoundBufLen, buffer, len);
	pWep->playSoundBufLen += len;
	//len = sizeof(g_playSoundBuf)/4;
	//DEV_MemCpy(pWep->playSoundBuf + pWep->playSoundBufLen, g_playSoundBuf, len);
	//pWep->playSoundBufLen += len;
	if (buffer[len -2] != 'o' && buffer[len -1] != 'k')
	{
		//结束标识
		return FALSE;
	}
	
	if (pWep->playSoundBuf[2] != 'A' && pWep->playSoundBuf[3] != 'M' && pWep->playSoundBuf[4] != 'R')
	{
		return FALSE;
	}
//	pWep->bPlaySound = TRUE;
	
	if (GetActiveScreenId() != pDd->screenId)
	{
		return FALSE;
	}
 	if (!pWep->bRecordSound )
 	{	
		pWep->bDeActiveWin = TRUE;
		pWep->recordStatus = RECORD_STATUS_PLAYING;
		if (!pWep->bOpenFullEditor)
		{
			record_prompt_screen(pWep);
		}
#ifdef WEP_DEBUG
		WEP_DebugPrint(">>>>>>>>>>>> start playing sound <<<<<<<<pWep->playSoundBufLen =%d<<<<<<<<<<<<<<",pWep->playSoundBufLen);
#endif
	#ifdef WEP_DEBUG
	//	WEP_DebugPrint(">>>>>>>>>>>> MMI_FS_Open <<<<<<<<fs_hdle =%d<<<<<<<<<<<<<<",fs_hdle);
	#endif
     	//	 SetProtocolEventHandler(record_play_callback_ext, MSG_ID_L4AUD_AUDIO_PLAY_FINISH_IND);
     		mdi_audio_stop_all();
		WepCamStop(); 
		if(MDI_AUDIO_SUCCESS == mdi_audio_play_string(pWep->playSoundBuf, (pWep->playSoundBufLen -2)/4, MDI_FORMAT_AMR, DEVICE_AUDIO_PLAY_ONCE, NULL,record_play_callback))		
		{
		#ifdef WEP_DEBUG
		WEP_DebugPrint(">>>>>>>>>>>> start playing sound  SUCCESS<<<<<<<<<<<<<<<<<<<<<<");
		#endif
     			pWep->bPlaySound = TRUE;
			DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, (pWep->playSoundBufLen/1000)*1000 + 5000, 
							(PFNTIMERCALLBACK)play_sound_callback, pWep);	
		}	
		else 
		{
				#ifdef WEP_DEBUG
				WEP_DebugPrint(">>>>>>>>>>>> start playing sound  FAIL<<<<<<<<<<<<<<<<<<<<<<");
				#endif
			return FALSE;
		}
	}

	return TRUE;
}

