void  start_record_voice(void)
{
	WEPAppData * pWep = g_Builder->pWep;
	FS_HANDLE fs_hdle;
#ifdef WEP_DEBUG
		WM_DebugPrint("******************* start record voice1 ****************");
#endif
	if (pWep->bPlaySound || pWep->bRecordSound)
	{   
		//语音播放时或开始录音时。
		return ;
	}
#ifdef WEP_DEBUG
		WM_DebugPrint("******************* start record voice2 ****************");
#endif
	{
		WepCamStop();
	}
	if ((fs_hdle = MMI_FS_Open((PU8)pWep->recordfilefullName , FS_READ_ONLY) )>= 0 )
	{
		MMI_FS_Close(fs_hdle);
		MMI_FS_Delete((PU8)pWep->recordfilefullName); 
	}
	WM_DebugPrint("start_record_voice:;fs_hdle = %d", fs_hdle);

	mdi_audio_stop_all();
	mdi_result mresult = mdi_audio_start_record_with_quality(pWep->recordfilefullName ,MDI_FORMAT_AMR,3,NULL, record_event_hdlr);
	WM_DebugPrint("start record result = %d", mresult);
       if(mresult != 0)  return;	
	
	pWep->bRecordSound = TRUE;
	pWep->secondCounts = MAX_RECORD_VOICE_SECONDS;
	pWep->bDeActiveWin = TRUE;
	pWep->recordStatus = RECORD_STATUS_RECORDING;
	record_prompt_screen(pWep);
}

void  end_record_voice(void)
{
//	int i;
	WEPAppData * pWep = g_Builder->pWep;
//	int32_t lenthOfPDP;
	/*uint32_t*/INT32 fileSize = 0;
//	mdi_result result;
    FS_HANDLE fs_hdle;

	if (pWep->recordStatus != RECORD_STATUS_RECORDING)
	{   
		//非录音状态
		return ;
	}

	pWep->recordStatus = RECORD_STATUS_IDLE;
	DEV_TimerStop(pWep->pDeviceData, TIMER_RECORD_PROMPT);
	mdi_audio_stop_record();
	
	fs_hdle = MMI_FS_Open((PU8)pWep->recordfilefullName, FS_READ_ONLY );
	if (fs_hdle < 0)
    {
#ifdef WEP_DEBUG
		WM_DebugPrint("******  fs_open is error = %d **********" , fs_hdle);
#endif
		pWep->bRecordSound = FALSE;
		pWep->bDeActiveWin = FALSE;
		pWep->pILUI->UIShow(pWep->pILUI,TRUE);
        return ;
    }

	MMI_FS_Read(fs_hdle, pWep->recordBuf, MAX_RECORD_BUFFER_LEN, /*(UINT*)*/(INT32*)&fileSize);
	pWep->recordBufLen = fileSize;
	MMI_FS_Close(fs_hdle);
	
//	mdi_audio_play_string(pWep->recordBuf, pWep->recordBufLen/4 , MDI_FORMAT_AMR, DEVICE_AUDIO_PLAY_ONCE, NULL,NULL);		
	
	//加入自定义结束符
	 if(fileSize > MAX_RECORD_BUFFER_LEN-2 )
	 {
		pWep->recordBuf[fileSize-2] = 'o';
		pWep->recordBuf[fileSize-1] = 'k';
		pWep->recordBufLen = fileSize;
 
	 }
	 else
	 {
	 
	pWep->recordBuf[fileSize++] = 'o';
	pWep->recordBuf[fileSize++] = 'k';
	pWep->recordBufLen = fileSize;
	 }
	
#ifdef WEP_DEBUG
	WM_DebugPrint("***** sound data size = %d ******************",fileSize);
#endif
#if 0//def WEP_DEBUG
for(i = 0; i < 20 ; i++)
	WM_DebugPrint("***** sound data  pWep->recordBuf [%d]= %d *****\n",i,pWep->recordBuf[i]);
#endif
	pWep->recordStatus = RECORD_STATUS_SENDING;
	record_prompt_screen(pWep);
	DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, 1000, 
						(PFNTIMERCALLBACK)record_data_send_data, pWep);
	

}

void  record_data_send_data(WEPAppData *pWep)
{
	int32_t lenthOfPDP;
#ifdef WEP_DEBUG
	WM_DebugPrint("************ record data send data %d******************",pWep->recordBufLen);
#endif	
	DEV_TimerStop(pWep->pDeviceData, TIMER_RECORD_PROMPT);

	if (pWep->recordBufLen >3000)
	{
			pWep->sendingLen = 3000;
			if ((pWep->sendingLen + pWep->sendingoffsetLen) >=pWep->recordBufLen)
			{
				pWep->sendingLen = pWep->recordBufLen - pWep->sendingoffsetLen;
			}
			pWep->pIPdp->RequestCodeSet(pWep->pIPdp,  9006);
 			pWep->pIPdp->SubRequestCodeSet(pWep->pIPdp, 0);
			lenthOfPDP = pWep->pIPdp->CPPackageCreate(pWep->pIPdp, pWep->pdp, sizeof(pWep->pdp),2); //TYPE_CP_SOUND
			pWep->pILnt->Send(pWep->pILnt, pWep->pdp, lenthOfPDP);
			pWep->sendingoffsetLen += pWep->sendingLen;
	
		if (pWep->sendingoffsetLen == pWep->recordBufLen)
		{
			pWep->sendingoffsetLen = 0;
			pWep->sendingLen = 0;
			pWep->recordStatus = RECORD_STATUS_SEND_FINISH;
			record_prompt_screen(pWep);

			DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, 1000, 
						(PFNTIMERCALLBACK)record_data_send_finish, pWep);
		
	 
			
		}
		else
		{
			DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, 1000, 
						(PFNTIMERCALLBACK)record_data_send_data, pWep);
		}	
	}
	else
	{
		pWep->sendingoffsetLen = 0;
		pWep->sendingLen = pWep->recordBufLen;
		pWep->pIPdp->RequestCodeSet(pWep->pIPdp,  9006);
 		pWep->pIPdp->SubRequestCodeSet(pWep->pIPdp, 0);
		lenthOfPDP = pWep->pIPdp->CPPackageCreate(pWep->pIPdp, pWep->pdp, sizeof(pWep->pdp),2);
		pWep->pILnt->Send(pWep->pILnt, pWep->pdp, lenthOfPDP);

		pWep->recordStatus = RECORD_STATUS_SEND_FINISH;
		record_prompt_screen(pWep);
		DEV_TimerStart(pWep->pDeviceData, TIMER_RECORD_PROMPT, 1000, 
					(PFNTIMERCALLBACK)record_data_send_finish, pWep);
		
	
	}

}
void  record_data_send_finish(WEPAppData *pWep)
{

#ifdef WEP_DEBUG
	WM_DebugPrint("************ record data send finish ******************");
#endif

	DEV_TimerStop(pWep->pDeviceData, TIMER_RECORD_PROMPT);
	pWep->bRecordSound = FALSE;
	pWep->recordStatus = RECORD_STATUS_IDLE;
	pWep->bDeActiveWin = FALSE;
	pWep->pILUI->UIShow(pWep->pILUI,TRUE);
}

