void menu_key_handle(void)
{
	WEPAppData * pWep = g_Builder->pWep;
	U16 keyCode, keyType;

	GetkeyInfo(&keyCode, &keyType);

	if (!pWep->bDeActiveWin)
	{
		return;
	}
	
	switch(keyCode)
	{
	case KEY_VOL_UP:
	case KEY_UP_ARROW:
		if (keyType == KEY_EVENT_UP)
		{			
			if (g_menu.focusItem != 0)
			{
				if (g_menu.focusItem == g_menu.first_item)
				{
					g_menu.first_item--;
					g_menu.last_item--;
				}
				g_menu.focusItem--;
			}
			else
			{
				g_menu.last_item  = g_menu.focusItem  =  g_menu.n_items -1;
				g_menu.first_item =  g_menu.n_items - g_menu.displayed_items;	
			}
			ui_menu_redraw();
		}
		break;
		
	case KEY_VOL_DOWN:
	case KEY_DOWN_ARROW:
		if (keyType == KEY_EVENT_UP)
		{
			if (g_menu.focusItem != g_menu.n_items -1)
			{
				if (g_menu.focusItem == g_menu.last_item)
				{
					g_menu.first_item++;
					g_menu.last_item++;
				}
				g_menu.focusItem++;
			}
			else
			{
				g_menu.focusItem  = 0;
				g_menu.first_item = 0;
				g_menu.last_item  = g_menu.displayed_items -1;
			}
			ui_menu_redraw();
		}
		break;

	case KEY_ENTER:
	case KEY_LSK:
		if (keyType == KEY_EVENT_UP)
		{
			ui_popmenu_command();
		}	
		break;

	case KEY_RSK:
	case KEY_LEFT_ARROW:
		if (keyType == KEY_EVENT_UP)
		{
			ui_popmenu_close();
			pWep->pILUI->UIShow(pWep->pILUI,TRUE);
		
		}	
		break;
	case KEY_END:
		if (keyType == KEY_EVENT_DOWN)
		{
			ui_popmenu_close();
			pWep->pILUI->UIShow(pWep->pILUI,TRUE);
		}
		break;
	default:
		break;

	}
}


