int8_t  mmi_popmenu_pen_position(PMENU *pPopMenu,mmi_pen_point_struct point)
{
	PMENU *pMenu;
	int16_t x = point.x;
	int16_t y = point.y;
	int16_t  x1, y1, width, height;
	uint8_t  i;

	pMenu = pPopMenu;
	if (pMenu == NULL)
	{
		return -20;
	}

	x1 = pMenu->x;
	y1 = pMenu->y;
	width = pMenu->width;
	height = pMenu->height;

	if (pMenu->bDisplayArrow)  //BN10030
	{
		//判断是否在上下图标
		if (PEN_CHECK_BOUND(x, y , x1  , y1 + POPMENU_ITEM_TAP_Y, popmenu_width/2, POPMENU_ARROW_AREA_HEIGHT))
		{
			return POPMENU_UP_ARROW;
		}
		
		if (PEN_CHECK_BOUND(x, y , x1 + popmenu_width/2, y1 + POPMENU_ITEM_TAP_Y, popmenu_width/2, POPMENU_ARROW_AREA_HEIGHT))
		{
		
			return POPMENU_DOWN_ARROW;
		}
		y1 += (2*POPMENU_ITEM_TAP_Y + POPMENU_ARROW_AREA_HEIGHT);
	}

	for (i = 0; i < pMenu->displayed_items; i++)
	{
		if (PEN_CHECK_BOUND(x, y , x1 + POPMENU_ITEM_TAP_X,  y1 , popmenu_width - 2* POPMENU_ITEM_TAP_X, /*POPMENU_ITEM_HIEGHT*/popmenu_item_height+POPMENU_ITEM_TEXT_TAP_Y))//BN10030
		{
			
			return (pMenu->first_item + i); 
		}
		
		y1 +=popmenu_item_height+POPMENU_ITEM_TEXT_TAP_Y;   //BN10030           
	}

	return -20;
}

