void ui_popmenu_show(IBuilder * pIBuilder)
{
	Builder * pBuilder = (Builder *)pIBuilder;
 //	UI * pUI = pBuilder->pUI;
 	WEPAppData * pWep = pBuilder->pWep;                            //BN10030
	uint8_t i=0;
	uint16_t str_len=0, str_len_max=0;
	int32_t str_w=0, str_h=0;
	

	//init pop menu parameters	
	gui_set_font(&MMI_medium_font);
	popmenu_item_height = WM_FontHeightGet();
	//popmenu_width = WM_StrWidthGet() ;
	popmenu_width = 0;

	i = g_menu.first_item ;
	g_menu.first_item  = 0;
	g_menu.last_item   = g_menu.n_items -1 ;

	for ( i = g_menu.first_item; i <= (g_menu.first_item + g_menu.last_item); i++)
	{
		//pop_item_width = WM_StrWidthGet((UI_character_type*)&g_menu.text[i]) ;
		gui_measure_string((UI_string_type)&g_menu.text[i], &str_w, &str_h);
		str_len = UTL_UniStrLen((byte_t *)&g_menu.text[i]);
		if(str_w > popmenu_width)
		{
			popmenu_width = str_w;
			str_len_max = str_len;
		}
	}
	popmenu_width += 5*POPMENU_ITEM_TAP_X * 2;//POPMENU_ITEM_TAP_X * str_len_max;

	if(popmenu_width > UI_device_width)
		popmenu_width = UI_device_height;// -POPMENU_ITEM_TEXT_TAP_X *2;

	popmenu_x = UI_device_width- popmenu_width - 2; 

	//	

	g_menu.height  =  (popmenu_item_height+POPMENU_ITEM_TEXT_TAP_Y)* (g_menu.n_items) + POPMENU_ITEM_TAP_Y * 2;
	g_menu.displayed_items = g_menu.n_items;
	g_menu.first_item  = 0;
	g_menu.focusItem   = 0;
	g_menu.last_item   = g_menu.n_items -1 ;
	
	if (g_menu.n_items > MAX_POPMENU_DISPLAY_ITEM)
	{
		//取消指示栏
		g_menu.height = (MAX_POPMENU_DISPLAY_ITEM) * popmenu_item_height + POPMENU_ITEM_TAP_Y * 2 ;//+ POPMENU_ARROW_AREA_HEIGHT + POPMENU_ITEM_TAP_Y; 
		g_menu.displayed_items = MAX_POPMENU_DISPLAY_ITEM;
		g_menu.first_item    = 0;
		g_menu.last_item     = MAX_POPMENU_DISPLAY_ITEM - 1;
		//g_menu.bDisplayArrow = TRUE;
	}

	g_menu.x = popmenu_x;
	g_menu.y = UI_device_height - MMI_softkey_height - g_menu.height - 2;
	g_menu.width = popmenu_width;


	popmenu_save_context();
	
	ui_menu_redraw();
	wgui_text_menuitem_reset_scrolling();//BN10082 disable menu item scrolling when pop menu
	
	change_left_softkey(STR_GLOBAL_OK, IMG_GLOBAL_OK);
	change_right_softkey(STR_GLOBAL_CANCEL,IMG_GLOBAL_BACK);
	redraw_left_softkey();
	redraw_right_softkey();
	
	pWep->bDeActiveWin = TRUE;
}


