signed short CSD_mmi_find_keyword(kal_uint8 * buf_p,kal_uint8 buf_len)
{
	int32_t len;
	int32_t i = 0;
	int32_t  find = -1;
	
	for (i = 0 ; i < MAX_KEYWORD_NUM ; i++)
	{
		len = UTL_UniStrLen(Wep_SmsKeyword[i]);
		if (len > 0)
		{
			find = DEV_MemFind(buf_p, buf_len, Wep_SmsKeyword[i], UTL_UniStrLen(Wep_SmsKeyword[i]));
			if (find >=0)
				return  1;
		}
	}

	return -1;
}

