static int32_t CSD_WEP_is_pen_in_softkey(mmi_pen_point_struct point)
{
	if((point.y >= MMI_softkeys[MMI_LEFT_SOFTKEY].y) &&
		(point.y <  MMI_softkeys[MMI_LEFT_SOFTKEY].y + MMI_softkeys[MMI_LEFT_SOFTKEY].height))
	{
		if((point.x >= MMI_softkeys[MMI_LEFT_SOFTKEY].x) &&
		(point.x <  MMI_softkeys[MMI_LEFT_SOFTKEY].x + MMI_softkeys[MMI_LEFT_SOFTKEY].width))
			return 1;
		else if((point.x >= MMI_softkeys[MMI_RIGHT_SOFTKEY].x) &&
		(point.x <  MMI_softkeys[MMI_RIGHT_SOFTKEY].x + MMI_softkeys[MMI_RIGHT_SOFTKEY].width))
			return 2;
		else
			return 0;
	}
	else
	{
		return 0;
	}
}

