static void CSD_SoftkeyUpHandler(void)
{
  WEPAppData * pWep = g_Builder->pWep;
	UI * pUI = (UI *)(pWep->pIUI);
// 	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);
	U16 keyCode, keyType;
	U8 i;
#ifdef WEP_DEBUG
WM_DebugPrint("CSD_SoftkeyUpHandler ");
#endif

	// if edit RSK changed,
	if(g_MTK_text_edit_RSK_changed)
	{
		g_CSD_text_edit_RSK_changed = FALSE;
		return ;
	}

	GetkeyInfo(&keyCode, &keyType);
#ifdef WEP_DEBUG
WM_DebugPrint("CSD_SoftkeyUpHandler keyCode=%d keyType=%d ",keyCode, keyType);
#endif

// 	if( (pUI->winID == WEP_WUI_EXIT_SCREEN)//logon UI use image
// 		&&(keyCode == KEY_LSK) )
// 	{
// 		pUI->welcomeShowHelpInfo = FALSE;
// 
// 		clear_key_handlers();
// 		ExitCategory57Screen();
// 
// 		pDd->bShowWelcomeAll = TRUE;
// 		UI_Paint(pWep->pIUI);
// 		pDd->bShowWelcomeAll = FALSE;
// 		return ;
// 	}

	if(pUI->dev_winType == DEV_UI_TYPE_FORM)
	{
		if(complete_inline_item_edit == handle_multi_line_rd_only_close)
		{
			complete_inline_item_edit=UI_dummy_function;
			CloseCategory57Screen();
			complete_inline_item_edit=handle_multi_line_rd_only_close;
		}	
		else
		{
			CloseCategory57Screen();
		}
	}
	else if(keyCode == KEY_ENTER)
	{
		keyCode = KEY_LSK;
	}

	for(i=0;i<2;i++)
	{
		if(((pUI->uiSK[i].softkeyPos == LEFT_SOFTKEY_ID)&&(keyCode == KEY_LSK))
			||((pUI->uiSK[i].softkeyPos == RIGHT_SOFTKEY_ID)&&(keyCode == KEY_RSK)))
		{
			pUI->pCmdAction(pWep->pILUI,pUI->uiSK[i].softkeyId);
#ifdef SUPPORT_FTP
			pUI->preSoftkeyID = pUI->uiSK[i].softkeyId;
#endif	
			break;
		}
	}
#ifdef WEP_DEBUG
WM_DebugPrint("CSD_SoftkeyUpHandler end");
#endif

}  

