void CSD_SetScreenSoftKey(bool_t keep_RSK_No_Change)
{
	UI * pUI = (UI *)(g_Builder->pWep->pIUI);
	byte_t i=0;
	show_softkey_background();
	set_left_softkey_label(NULL);
#ifdef WEP_DEBUG
 
#endif
	if( !keep_RSK_No_Change ) 
		set_right_softkey_label(NULL);
	for(i=0;i<2;i++)
	{
		if(pUI->uiSK[i].softkeyPos == LEFT_SOFTKEY_ID)
		{
		#ifdef WEP_DEBUG
		#endif

			set_left_softkey_label((UI_string_type)(pUI->uiSK[i].softkeyTitle));
			SetLeftSoftkeyFunction (CSD_SoftkeyUpHandler, KEY_EVENT_UP);
		}
		else if(pUI->uiSK[i].softkeyPos == RIGHT_SOFTKEY_ID)
		{
		#ifdef WEP_DEBUG
 
		#endif

			if( !keep_RSK_No_Change ) 
			{
				set_right_softkey_label((UI_string_type)(pUI->uiSK[i].softkeyTitle));
				SetRightSoftkeyFunction (CSD_SoftkeyUpHandler, KEY_EVENT_UP);
			}
		}
	}
	
	show_left_softkey();
	show_right_softkey();
	redraw_left_softkey();
	redraw_right_softkey();
}  

