static void SIM_inline_singleline_inputbox_key_handler(S32 vkey_code,S32 key_state)
{
#if(MMI_BUILD_TYPE==BUILD_TYPE_X86WIN32)
	if(key_state)
	{	switch(vkey_code)
		{	case 37:	inline_edit_singleline_inputbox_previous_character();
						break;
			case 38:	SIM_inline_text_edit_handle_up_arrow();
						break;
			case 39:	inline_edit_singleline_inputbox_next_character();
						break;
			case 40:	SIM_inline_text_edit_handle_down_arrow();
						break;
			case 45:	inline_edit_singleline_inputbox_toggle_insert_mode();
						break;
			case 46:	inline_edit_singleline_inputbox_delete_current_character();
						break;
		}
	}
#else
	UI_UNUSED_PARAMETER(vkey_code);
	UI_UNUSED_PARAMETER(key_state);
#endif
}

