static void SIM_SetInlineMultiLineRdOnly(InlineItem *item, U8* buffer, S32 buffer_size, U16 input_type, U8 max_lines)	//input_type :- Other items are hilightable or not.
{
	wgui_inline_item_text_edit	*i;
	if(n_inline_text_edit_items>=MAX_INLINE_TEXT_EDIT_ITEMS) return;
	item->item=(void*)&wgui_inline_text_edit_items[n_inline_text_edit_items];
	item->flags=INLINE_ITEM_TYPE_MULTI_LINE_RD_ONLY;

	n_inline_text_edit_items++;

	i=(wgui_inline_item_text_edit*)item->item;
	i->max_lines = max_lines;
	i->title=0;
	i->title_icon=0;
	i->buffer=buffer;
	i->buffer_size=buffer_size;
	i->flags=0;
	i->input_type=input_type;

	item->text_p=i->buffer;
	item->handler=SIM_handle_inline_multi_line_rd_only; // Youth modified

	i->edit_complete_callback=NULL;
	i->custom_setup_function=NULL;
	i->validation_callback=NULL;
	
	i->UCS2_count=-1;
	MMI_multi_line_inputbox_present =0;//2 ;// To identify ReadOnly inline-multiline inputbox
} // end SIM_SetInlineMultiLineRdOnly()


