void CSD_CheckBox_handler(S32 x,S32 y,S32 width,S32 height,S32 key_code,S32 key_event,U8** text_p,void *item,U32 flags,U8* history_buffer)
{
	WEPAppData * pWep = g_Builder->pWep;
	UI * pUI = (UI *)(pWep->pIUI);
	wgui_inline_image_text	*image_item = (wgui_inline_image_text	*)item;

	switch(key_code) 
	{
		case KEY_UP_ARROW: 
			inline_text_edit_handle_up_arrow();
		break;

		case KEY_DOWN_ARROW: 
			inline_text_edit_handle_down_arrow();
		break;

// 		case KEY_0: 
 		case KEY_ENTER:
		{
			int inx;

			for(inx=0; inx<n_inline_image_text; inx++){
				if (item == &wgui_inline_image_text_items[inx])
					break;
			}
			 
			if (pUI->checkBoxValue[inx] == 0)
			{
				image_item->image1 = (UI_image_type)get_image(IMG_VIEWCHAT_CHECKBOX2);
				pUI->checkBoxValue[inx] = 1;
			} else{
				image_item->image1 = (UI_image_type)get_image(IMG_VIEWCHAT_CHECKBOX1);
				pUI->checkBoxValue[inx] = 0;
			}
			wgui_show_image_text_control(image_item);	
 
			redraw_current_inline_item();
		}
		break;
			
		default:
		break;
	} 
	
	UI_UNUSED_PARAMETER(x);
	UI_UNUSED_PARAMETER(y);
	UI_UNUSED_PARAMETER(height);
	UI_UNUSED_PARAMETER(width);
	UI_UNUSED_PARAMETER(key_event);
	UI_UNUSED_PARAMETER(text_p);
	UI_UNUSED_PARAMETER(flags);
}

