static void CSD_set_inline_items(UI * pUI)
{
	int inx;
//	if(pUI->nControls == 2)// bug 10102
//	MMI_fixed_list_menu.flags |= UI_LIST_MENU_DISABLE_SCROLLBAR;

	for(inx=0;inx<pUI->nControls;inx++)
	{
		switch(pUI->CtrlType[inx])
		{
			case CTL_EDIT:
			{
				U32 editInx; 
				s16 editType= INPUT_TYPE_NUMERIC;

				for(editInx=0;editInx<pUI->nEditNum;editInx++)
				{
					if(pUI->ctrlEditIndex[editInx] == inx)
					{
						break;
					}
				}

				if((pUI->editType[editInx] == IME_TXT)
					|| (pUI->editType[editInx] == (IME_PIN|IME_TXT)))
				{
				WEPAppData * pWep = pUI->pWep;
					if(pUI->editType[editInx] & IME_PIN) 
					{
						editType = INPUT_TYPE_ALPHANUMERIC_PASSWORD;
					} 
					else  
					{
					if(pUI->winID == WEP_WUI_CHAT_SCREEN)
						editType = INPUT_TYPE_SM_PINYIN ;
					else
						editType = INPUT_TYPE_ALPHANUMERIC_SENTENCECASE;
						/*pangpeng add for fixed the default inputtype*/
					}
					if((!pWep->bMsgButtonAdded)&&(pUI->winID == WEP_WUI_CHAT_SCREEN))
					SetInlineItemActivation (&wgui_inline_items[inx], KEY_LSK, KEY_EVENT_UP);
					else
					SetInlineItemActivation (&wgui_inline_items[inx], KEY_ENTER, KEY_EVENT_UP);
					MMI_multi_line_inputbox_present = 0;	//Add by YHB, 2007-01-23.
				#ifdef USE_NEW_SIM_CONTROL
					SIM_SetInlineItemFullScreenEdit(&wgui_inline_items[inx], 0, IMG_VIEWCHAT_SLOGO, 
							(U8*)(pUI->pEditText[editInx]), pUI->nEditMaxLen[editInx]/2+1, editType);
				#else
					SetInlineItemFullScreenEdit(&wgui_inline_items[inx], 0, 0, 
							(U8*)(pUI->pEditText[editInx]), pUI->nEditMaxLen[editInx]+1, editType);
				#endif
					SetInlineFullScreenEditCustomFunction(&wgui_inline_items[inx], CSD_InlineFullScreenEditCustomFunction);
				}
				else
				{
					if(pUI->editType[editInx] & IME_PIN) 
					{
						editType = INPUT_TYPE_NUMERIC_PASSWORD ;
					}
					else  
					{
						editType = INPUT_TYPE_NUMERIC;
					}

					SetInlineItemActivation(&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);
				#ifdef USE_NEW_SIM_CONTROL
					SIM_SetInlineItemTextEdit(&wgui_inline_items[inx], (U8*)(pUI->pEditText[editInx]),
									pUI->nEditMaxLen[editInx]+1 , editType);
				#else
					SetInlineItemTextEdit(&wgui_inline_items[inx], (U8*)(pUI->pEditText[editInx]),
									pUI->nEditMaxLen[editInx]+1 , editType);
				#endif
				}
			}
			break;

			case CTL_EDIT_ML:	// MultiLine Edit
			{
				S16 editInx;

				for(editInx=0;editInx<pUI->nEditNum;editInx++) {
					if(pUI->ctrlEditIndex[editInx] == inx) {
						break;
					}
				}

				SetInlineItemActivation (&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);
			#ifdef USE_NEW_SIM_CONTROL
				SIM_SetInlineItemMultiLineEdit(&wgui_inline_items[inx], 
						(U8*)(pUI->pEditText[editInx]), NULL, pUI->nEditMaxLen[editInx]+1, 
						INPUT_TYPE_ALPHANUMERIC_SENTENCECASE);
			#else
				SetInlineItemMultiLineEdit(&wgui_inline_items[inx], 
						(U8*)(pUI->pEditText[editInx]), NULL, pUI->nEditMaxLen[editInx]+1, 
						INPUT_TYPE_ALPHANUMERIC_SENTENCECASE);
 			#endif
				SetInlineMultiLineEditCustomFunction(&wgui_inline_items[inx], CSD_InlineMultiLineEditCustomFunction);
			}
			break;
			
			case CTL_STRING:
			{
				int strInx;

				for(strInx=0;strInx<pUI->nStringNum;strInx++) {
					if(pUI->ctrlStringIndex[strInx] == inx) {
						break;
					}
				}

// 				if( (pUI->winID == WEP_WUI_CHAT_SCREEN)
// 					&&(inx == pUI->chatStrCtrlInx) )
// 				{
// 					SetInlineItemActivation(&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);
// 			#ifdef USE_NEW_SIM_CONTROL
// 					SIM_SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
// 							pfnKKUnicodeStrlen(pUI->pStringText[strInx]), INPUT_TYPE_ALPHANUMERIC_SENTENCECASE, (U8)pUI->nStringLineNum[strInx]);
// 			#else
// 					SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
// 							pfnKKUnicodeStrlen(pUI->pStringText[strInx]), INPUT_TYPE_ALPHANUMERIC_SENTENCECASE, (U8)pUI->nStringLineNum[strInx]);
// 			#endif
// 				}
// 				else
				{
					SetInlineItemActivation (&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);

		if(pUI->nStringLineNum[strInx] > 0)
		{

	#ifdef USE_NEW_SIM_CONTROL
			SIM_SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
				pfnKKUnicodeStrlen((const S8*)(pUI->pStringText[strInx])), 
				INPUT_TYPE_ALPHANUMERIC_SENTENCECASE ,(U8)pUI->nStringLineNum[strInx]);
	#else
			SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
				pfnKKUnicodeStrlen((const S8*)(pUI->pStringText[strInx])), 
				INPUT_TYPE_ALPHANUMERIC_SENTENCECASE ,(U8)pUI->nStringLineNum[strInx]);
	#endif
		}
//					if(pUI->nStringLineNum[strInx] > 0)
//					{
//
//				#ifdef USE_NEW_SIM_CONTROL
//						SIM_SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
//						pfnKKUnicodeStrlen((const S8*)(pUI->pStringText[strInx])), 
//							INPUT_TYPE_ALPHANUMERIC_SENTENCECASE ,(U8)pUI->nStringLineNum[strInx]);
//				#else
//						SetInlineMultiLineRdOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]),
//							pfnKKUnicodeStrlen((const S8*)(pUI->pStringText[strInx])), 
//							INPUT_TYPE_ALPHANUMERIC_SENTENCECASE ,(U8)pUI->nStringLineNum[strInx]);
//				#endif
//					}
					else
					{
						SetInlineItemActivation (&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);
						SetInlineItemDisplayOnly(&wgui_inline_items[inx], (U8*)(pUI->pStringText[strInx]));
// 									SetInlineItemActivation (&wgui_inline_items[inx], KEY_0, KEY_EVENT_UP);
 
// 				get_image(62904), NULL, NULL, 20, 0, 0, INPUT_TYPE_ALPHANUMERIC_SENTENCECASE);
					}
				}
			}
			break;

			case CTL_CHOICE:
			{
				int choiceGroupId, startSubItem = 0;
				int n;

				for(choiceGroupId=0;choiceGroupId<pUI->nChoiceGroupNum;choiceGroupId++) {
					if(pUI->ctrlChoiceIndex[choiceGroupId] == inx) {
						break;
					}
				}
				for(n=0;n<choiceGroupId;n++) {
					startSubItem += pUI->nSubItemNumOfChoiceGroup[n];
				}
				SetInlineItemActivation(&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, KEY_EVENT_UP);
				SetInlineItemSelect(&wgui_inline_items[inx], pUI->nSubItemNumOfChoiceGroup[choiceGroupId],
											(U8 **)&(pUI->pSubItemText[startSubItem]), (S32 *)&pUI->nChoiceGroupSelectedIndex[choiceGroupId]);
			}
			break;

			case CTL_LABEL:
			{
				int lblInx;

				for(lblInx=0;lblInx<pUI->nLabelNum;lblInx++) {
					if(pUI->ctrlLabelIndex[lblInx] == inx) {
						break;
					}
				}

				if(pUI->bCanActive[inx] == FALSE)
				{
					//SetInlineItemActivation (&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, KEY_EVENT_UP);
					DisableInlineItemHighlight(&wgui_inline_items[inx]);
					SetInlineItemCaption(&wgui_inline_items[inx], (U8*)pUI->pLabelText[lblInx]);
				}
				else
				{
					SetInlineItemActivation (&wgui_inline_items[inx], INLINE_ITEM_ACTIVATE_WITHOUT_KEY_EVENT, 0);
					SetInlineItemDisplayOnly(&wgui_inline_items[inx], (U8*)(pUI->pLabelText[lblInx]));
				}
			}
			break;

			case CTL_SPACE:
				{
					
				DisableInlineItemHighlight(&wgui_inline_items[inx]);
				SetInlineItemCaption(&wgui_inline_items[inx], NULL);

				}
			break;

			case CTL_CHECKBOX:
			{
				int checkItemInx;
				UI_image_type image;
				
				//取得当前item在整个checkbox item中的索引
				for(checkItemInx=0;checkItemInx<pUI->nCheckboxItem;checkItemInx++) {
					if(pUI->ctrlCheckItemIndex[checkItemInx] == inx) {
						break;
					}
				}
				
				image = pUI->checkBoxValue[checkItemInx] == 1 ? (UI_image_type)get_image(IMG_VIEWCHAT_CHECKBOX2):(UI_image_type)get_image(IMG_VIEWCHAT_CHECKBOX1);
				SetInlineItemActivation (&wgui_inline_items[inx], KEY_ENTER, KEY_EVENT_UP);
				CSD_SetInlineItemCheckItem(&wgui_inline_items[inx], (U8*)(pUI->pCheckText[checkItemInx]), 
					image, NULL, NULL, 20, 0, 0, INPUT_TYPE_ALPHANUMERIC_SENTENCECASE);
			//ShowAsControl(&wgui_inline_items[inx]);
			}
			break;
			case CTL_PICTURE:
			{
				int picItemInx,imgInx;
				Builder * pBuilder = (Builder *)g_Builder;

				for(picItemInx = 0;picItemInx < pUI->numOfPictureItem;picItemInx++)
				{
					if(pUI->ctrlPictureIndex[picItemInx] == inx) {		
						imgInx = pUI->imgInxOfPictureItem[picItemInx];
						gui_show_image(0, 0, pBuilder->stPicture[imgInx].pszPicData);				
						break;
					}
				}
				CSD_SetScreenSoftKey(FALSE);
			}
			break;
			default:
			break;
		}
	}
}  

