static int32_t UI_ChatInputGet(IBuilder * pIBuilder, byte_t * szData, int16_t * piDataLen,int16_t *piTextCursorPos)
{
	Builder * pBuilder = (Builder *)pIBuilder;
 	UI  * pUI = pBuilder->pUI;
	int32_t i,nLen = 0;

	if(szData != NULL)
	{
		for(i = 0; i < pUI->nEditNum; i++)
		{
			if(pUI->ctrlEditIndex[i] == pUI->chatInputCtrlInx)
			{
				nLen = pfnKKUnicodeStrlen((S8*)pUI->pEditText[i]);
				break;
			}
		}

		if(nLen > 0)
		{
			nLen = DEV_LocStr2NetUniByte(szData, pUI->pEditText[i], nLen);
			if(piTextCursorPos != NULL)
			{
// 				int32_t tmp,pos;
//取得光标的位置(网络字节)
// 				pos = DEV_LocStr2NetUniByte(szData, tmpBuf, tmp);
// 				*piTextCursorPos = pos;
				*piTextCursorPos = nLen;
			}
		}
		else
		{
			if(piTextCursorPos != NULL) {
				*piTextCursorPos = 0;
			}
		}
		if(piDataLen != NULL) {
			*piDataLen = (int16_t)nLen;
		}

		return 0;
	}

	if(piDataLen != NULL) {
		*piDataLen = 0;
	}

	return -1;
}//end UI_ChatInputGet()

