static 	bool_t  UI_ChatFaceSymAdd(IBuilder * pIBuilder, int32_t imgIndex, byte_t * szSym, int32_t nSymLen)
{
	Builder * pBuilder = (Builder *)pIBuilder;

	if(pBuilder->chatSymbolNum < MAX_CHAT_FACE_NUMBER)
	{
		DEV_NetUniByte2LocStr(&(pBuilder->chatFaceSymbol[pBuilder->chatSymbolNum][0]), szSym, nSymLen);
		pBuilder->chatFaceImageId[pBuilder->chatSymbolNum] = imgIndex;
		pBuilder->chatSymbolNum++;
		return TRUE;
	}
	return FALSE;
}

