static void UI_MsgAdd(IUI * pIUI, byte_t * szMsg, int32_t nLen)
{
	UI * pUI = (UI *)pIUI;
	WEPAppData * pWep = pUI->pWep;
	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);

	if(pUI != NULL) {
		if(nLen > 0) {
			byte_t * pSZ;

			DEV_MemSet(pDd->bufMessage,0x00,sizeof(pDd->bufMessage));
			pDd->msgSize = DEV_NetUniByte2LocStr(pDd->bufMessage,szMsg,
				(nLen < sizeof(pDd->bufMessage)-2) ?nLen : (sizeof(pDd->bufMessage)-2));

			DEV_MemSet(pDd->titleMessage,0x00,sizeof(pDd->titleMessage));
			pSZ = GETSTRRES(SZ_MSGTITLE, pWep->languageId);
			DEV_NetUniByte2LocStr(pDd->titleMessage, pSZ, UTL_UniStrLen(pSZ));
		}
	}
}

