static int32_t UI_WinCreate(IBuilder * pIBuilder,
		int32_t dev_winType, int32_t winId, byte_t * title, int32_t titleSize)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
// 	WEPAppData * pWep = pBuilder->pWep;
// 	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);
	int i;

	if (pUI == NULL) {
		return -1;
	}

	pUI->Vtbl.WinDestroy((IUI*)pUI);

	// clear UI data except IUI
	DEV_MemSet( (byte_t *)pUI + sizeof(IUI), 0x0, sizeof(UI)-sizeof(IUI) );

	pUI->pWep  = pBuilder->pWep;
	pUI->winID = winId;
	pUI->dev_winType = dev_winType;

	for(i=0;i<UI_MAX_CTL_NUM;i++)
	{
		pUI->bCanActive[i] = TRUE;
	}
	pUI->iActiveCtl = -1;

// 	for(i=0; i<TOTAL_ELEMENTS(pUI->pSubItemCaption); i++){
// 		pUI->pSubItemCaption[i] = pUI->subItemCaption[i];
// 	}
	
// 	DEV_MemSet(pUI->nSubItemNumOfChoiceGroup, 0x00, sizeof(pUI->nSubItemNumOfChoiceGroup));

	DEV_MemSet(pBuilder->strBuf, 0x00, sizeof(pBuilder->strBuf));

	///////////////////////////////////////////////////////////////////////////
	if(titleSize > 0)
	{
		DEV_MemSet(pUI->screenTitle, 0x0,sizeof(pUI->screenTitle));	
		DEV_NetUniByte2LocStr(pUI->screenTitle, title, 
			(titleSize < sizeof(pUI->screenTitle)) ? titleSize : sizeof(pUI->screenTitle));
	}
	else 
	{
		int32_t app_titleSize = 0;
		// DEV_MemSet(pUI->screenTitle, 0x0,sizeof(pUI->screenTitle));	
		DEV_MemSet(pUI->screenTitle, 0x0,sizeof(pUI->screenTitle));
		app_titleSize = UTL_UniStrLen(GETSTRRES(SZ_MITALK_TITLE, pUI->pWep->languageId));
		DEV_NetUniByte2LocStr(pUI->screenTitle, GETSTRRES(SZ_MITALK_TITLE, pUI->pWep->languageId), 
			(app_titleSize < sizeof(pUI->screenTitle)) ? app_titleSize : sizeof(pUI->screenTitle));
		
	}

// #ifdef WEP_DEBUG
//   if( (winId == 67)	// 聊天表情1
//     ||(winId == 68)	// 聊天表情2
//     ||(winId == 62) )// 头像选择
//   {
// 		pUI->dev_winType = DEV_UI_TYPE_LIST_LITTLE_ICON;
// 	}		
// #endif
	// if screen type is LIST,
	if(dev_winType != DEV_UI_TYPE_FORM) {
		UI_ListAdd(pIBuilder, NULL, 0, 0);
	}

	return 0;
}//end UI_WinCreate()

