static void UI_ChoiceGroupAdd(IBuilder * pIBuilder,byte_t * szTitle, int32_t nTitleLen, int32_t itemNum)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;

	if (pUI != NULL)
	{
		if(nTitleLen > 0)	{
			UI_LabelAdd(pIBuilder, szTitle, nTitleLen, FALSE);
		}

		pUI->ctrlChoiceIndex[pUI->nChoiceGroupNum] = pUI->nControls;
		pUI->nChoiceGroupNum ++;

		pUI->CtrlType[pUI->nControls] = CTL_CHOICE;
		pUI->bCanActive[pUI->nControls] = TRUE;
		pUI->nControls ++;
		pUI->totalLineNum++;
	}
	return ;
}

////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////
static void UI_ChoiceItemAdd(IBuilder * pIBuilder ,int32_t itemID, int32_t groupID, int32_t index, 
														 byte_t * szTitle, int32_t nTitleLen,	bool_t itemIsSelected)
{
	Builder * pBuilder = (Builder *)pIBuilder;
// 	WEPAppData * pWep = pBuilder->pWep;
	UI * pUI = pBuilder->pUI;

	if( (pUI != NULL)
		&&(pUI->nChoiceGroupNum > 0)
		&&(pUI->nChoiceGroupNum > groupID)
		&&(pUI->nSubItemNum < UI_MAX_SUBITEM_NUM-1) )
	{
		int32_t nSubItem;

		nSubItem = pUI->nSubItemNum++;

		if(pUI->nCurBufLen % 2 != 0)
		{
			pUI->buffer[pUI->nCurBufLen] = 0x0;
			pUI->nCurBufLen++;
		}
		pUI->pSubItemText[nSubItem] = &(pUI->buffer[pUI->nCurBufLen]);
		pUI->subItemTextLen[nSubItem] = DEV_NetUniByte2LocStr(&(pUI->buffer[pUI->nCurBufLen]), szTitle, nTitleLen);
		pUI->nCurBufLen += pUI->subItemTextLen[nSubItem];
		pUI->buffer[pUI->nCurBufLen] = 0x0;
		pUI->buffer[pUI->nCurBufLen+1] = 0x0;
		pUI->nCurBufLen += 2;

		if(itemIsSelected) {
			pUI->nChoiceGroupSelectedIndex[groupID] = pUI->nSubItemNumOfChoiceGroup[groupID];
		}
		pUI->nSubItemNumOfChoiceGroup[groupID]++;
	}
}//end UI_ChoiceItemAdd()

