static bool_t UI_ListAdd(IBuilder * pIBuilder,
							  byte_t * szTitle, int32_t nTitleLen,
							  int32_t nHeightDecVal)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
// 	WEPAppData * pWep = pBuilder->pWep;
// 	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);

	if (pUI != NULL)
	{
		if(nTitleLen > 0)	
		{
			UI_LabelAdd(pIBuilder, szTitle, nTitleLen, FALSE);
		}

		pUI->nChoiceGroupNum ++;

		pUI->CtrlType[pUI->nControls] = CTL_LIST;
		pUI->bCanActive[pUI->nControls] = TRUE;
		pUI->nControls ++;
		pUI->totalLineNum++;
	}
	return TRUE;
}//end UI_ListAdd()

