static void UI_ListItemAdd(IBuilder * pIBuilder, int32_t imgIndex, int32_t itemID,
								int32_t index, byte_t * szTitle, int32_t nTitleLen, bool_t itemIsSelected)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
 //	WEPAppData * pWep = pBuilder->pWep;
 //	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);
	FS_HANDLE pFile;
	UI_character_type fileName[MAX_FILENAME_LEN];
	UI_character_type		filenameptr[MAX_FILENAME_LEN];
	/*int32_t*/INT32 fileLen = 0;
	/*int32_t*/INT32 bytesRead;
	UIPictureData * pstPic = NULL;
	int32_t result,image_width,image_height;

	if( (pUI != NULL)
		&&(pUI->nSubItemNum < UI_MAX_SUBITEM_NUM-1) )
	{
//save item text
		if(pUI->nCurBufLen % 2 != 0)
		{
			pUI->buffer[pUI->nCurBufLen] = 0x0;
			pUI->nCurBufLen++;
		}
		pUI->pSubItemText[pUI->nSubItemNum] = &(pUI->buffer[pUI->nCurBufLen]);
		pUI->subItemTextLen[pUI->nSubItemNum] = DEV_NetUniByte2LocStr(&(pUI->buffer[pUI->nCurBufLen]), szTitle, nTitleLen);
		pUI->nCurBufLen += pUI->subItemTextLen[pUI->nSubItemNum];
		pUI->buffer[pUI->nCurBufLen] = 0x0;
		pUI->buffer[pUI->nCurBufLen+1] = 0x0;
		pUI->nCurBufLen += 2;
		
//save item image index
		if(imgIndex < MAX_LOCAL_LIST_ICON_INDEX) {
			//imgIndex -= 1;
			if(imgIndex>=0)
			{
				pUI->subItemImage[pUI->nSubItemNum] = get_image((UI_image_ID_type)(IMG_VIEWCHAT_000+imgIndex)) ; 

				if(pUI->subItemImage[pUI->nSubItemNum] == get_image((UI_image_ID_type)(IMG_GLOBAL_DEFAULT)))
				{
					pUI->subItemImage[pUI->nSubItemNum] = NULL;
				}	
			}			
		} else {
			pUI->subItemImage[pUI->nSubItemNum] = (UI_image_type)pBuilder->stPicture[imgIndex-MAX_LOCAL_LIST_ICON_INDEX].pszPicData;
//  			imgIndex -= MAX_LOCAL_LIST_ICON_INDEX;//表示该Item的图标由服务器直接发过来，保存在pBuilder->stPicture中
		}

		pUI->subItemImgIndex[pUI->nSubItemNum] = imgIndex;

		if( pUI->subItemImage[pUI->nSubItemNum] == NULL)
		{
			//get picture from files (download from server and saved to local)
			sprintf((S8*)fileName, "%s%03d.gif", WEP_RES_PATH, imgIndex);
			pfnKKAnsiiToUnicodeString((S8 *)filenameptr,(S8 *)fileName);

			result = -1;
			image_width = 0;
			image_height = 0;
			
			if((pFile = MMI_FS_Open((PU8)filenameptr, FS_READ_ONLY )) >= 0 )
			{
				MMI_FS_GetFileSize(pFile, /*(UINT *)*/&fileLen);
				pstPic = &pBuilder->stPicture[pBuilder->numOfPicture+pUI->numOfPicture];
				pstPic->pszPicData = (byte_t *)DEV_Malloc(MALLOC_MODULE_PICTURE_DATA + pBuilder->numOfPicture+pUI->numOfPicture, fileLen+CSD_IMAGE_HEADER_LEN);
				if(pstPic->pszPicData != NULL) {
					pstPic->pszPicData[0] = IMAGE_TYPE_GIF;
					pstPic->pszPicData[1] = 0x0;
					pstPic->pszPicData[2] = LBYTE(fileLen);
					pstPic->pszPicData[3] = HBYTE(fileLen);
					pstPic->pszPicData[4] = 0x0;
					pstPic->pszPicData[5] = 0x0;
					pstPic->pszPicData[6] = 0x0;
					pstPic->pszPicData[7] = 0x0;
					MMI_FS_Read(pFile, pstPic->pszPicData+CSD_IMAGE_HEADER_LEN, (UINT)fileLen,/*(UINT*)*/(INT32*)&bytesRead);
					pstPic->lenOfPicData = fileLen+CSD_IMAGE_HEADER_LEN;
					pstPic->pictureType = IMAGE_TYPE_GIF;
					pUI->subItemImage[pUI->nSubItemNum] = (UI_image_type)pstPic->pszPicData;
					pUI->numOfPicture++;
					pUI->picUsedBufLen+=(fileLen+CSD_IMAGE_HEADER_LEN);
				}
				MMI_FS_Close (pFile);
				result = gdi_image_get_dimension_file((PS8) filenameptr, &image_width, &image_height);
			}
			if( (pUI->subItemImage[pUI->nSubItemNum] == NULL) ||(image_width <= 0) || (image_height <= 0) ||( result < 0 ))
			{
				if(pUI->dev_winType == DEV_UI_TYPE_LIST_LARGE_ICON)
				{
					pUI->subItemImage[pUI->nSubItemNum] = get_image((UI_image_ID_type)(IMG_VIEWCHAT_SLOGO)) ; //pUI->subItemImgIndex[pUI->nSubItemNum] = IMG_WEP_default;
				}
				else
				{
					pUI->subItemImage[pUI->nSubItemNum] = get_image((UI_image_ID_type)(IMG_VIEWCHAT_000)) ; //pUI->subItemImgIndex[pUI->nSubItemNum] = IMG_WEP_sdefault;
				}
			}
		}

		// check if current item need to be selected,
		if(itemIsSelected) 
		{
			pUI->nChoiceGroupSelectedIndex[0] = pUI->nSubItemNum;
		}
		pUI->nSubItemNum++;
	}
}//end UI_ListItemAdd()

