static int32_t UI_ListItemDel(IUI * pIUI, int32_t iIndex)
{
	UI * pUI = (UI *)pIUI;
	int32_t j, nItemCount;

	nItemCount = pUI->nSubItemNum;

	if ((pUI != NULL) && (pUI->nChoiceGroupNum == 1))
	{
		if(nItemCount > 0 && iIndex < nItemCount)
		{
			for(j=iIndex;j<nItemCount-1;j++)
			{
				pUI->pSubItemText[j] = pUI->pSubItemText[j+1];
				pUI->subItemTextLen[j] = pUI->subItemTextLen[j+1];
				pUI->subItemImage[j] = pUI->subItemImage[j+1];
			}
			pUI->nSubItemNum--;
			return iIndex;
		}
 	}
	return -1;
}//end UI_ListItemDel()


