static bool_t UI_LabelAdd(IBuilder * pIBuilder,
						   byte_t * szString, int32_t nLen, bool_t bHoriCentered)
{
	Builder * pBuilder = (Builder *)pIBuilder;
// 	WEPAppData * pWep = pBuilder->pWep;
	UI * pUI = pBuilder->pUI;

	if (pUI != NULL)
	{
		int32_t stringWidth;

		if(pUI->nCurBufLen % 2 != 0)
		{
			pUI->buffer[pUI->nCurBufLen] = 0x0;
			pUI->nCurBufLen++;
		}

		pUI->pLabelText[pUI->nLabelNum] = &(pUI->buffer[pUI->nCurBufLen]);
		pUI->labelTextLen[pUI->nLabelNum] = DEV_NetUniByte2LocStr(&(pUI->buffer[pUI->nCurBufLen]), szString, 
			(nLen < MAX_SUBITEM_CAPTION_LEN / sizeof(UI_character_type)) ? nLen : MAX_SUBITEM_CAPTION_LEN / sizeof(UI_character_type));
		pUI->nCurBufLen += pUI->labelTextLen[pUI->nLabelNum];
		pUI->buffer[pUI->nCurBufLen] = 0x0;
		pUI->buffer[pUI->nCurBufLen+1] = 0x0;
		pUI->nCurBufLen += 2;

		pUI->ctrlLabelIndex[pUI->nLabelNum] = pUI->nControls;
		pUI->CtrlType[pUI->nControls] = CTL_LABEL;
		stringWidth = gui_get_string_width(pUI->pLabelText[pUI->nLabelNum]);
		if(stringWidth >= UI_device_width-6)
		{
			pUI->bCanActive[pUI->nControls] = TRUE;
		}
		else
		{
			pUI->bCanActive[pUI->nControls] = FALSE;
		}

		pUI->nLabelNum ++;
		pUI->nControls ++;
		pUI->totalLineNum++;

	}
	return TRUE;
}//end UI_LabelAdd()

