static int32_t UI_StrAdd(IBuilder * pIBuilder,
			   byte_t * szString, int32_t nLen, int32_t nextItemType)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
// 	WEPAppData * pWep = pBuilder->pWep;
// 	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);

	UI_character_type sz[UI_MAX_SINGLE_STRING_LEN+2];
	int32_t strLen=0, nMaxLine, i;

	pUI->MultiLineRdOnlyCategory=FALSE;
	
	if (pUI != NULL)
	{
		if(nLen > UI_MAX_SINGLE_STRING_LEN) {
			nLen = UI_MAX_SINGLE_STRING_LEN;
		}
		if(nLen > 0)
		{
			strLen = DEV_NetUniByte2LocStr(sz, szString, nLen);

#if 1//for some code MTK can not display correct
		if(strLen >= 2)
		{
			int  j,temp_len;
	
			temp_len = strLen - 2;
			for(i = 0;i<temp_len;i++)
			{
				if((sz[i]==0x3000)&&(sz[i+1]==0x3000))//
				//	&&(sz[i+2]==0x30)&&(sz[i+3]==0x00))
				{
					//strLen -= 2;
					for(j = strLen-1;j>i;j--)
					{
						sz[j+3] = sz[j];
					}
					sz[strLen+3] = 0;
					sz[i++] = 0x000a;
			//		sz[i++] = 0x0a;
					sz[i++] = 0x20;
					sz[i++] = 0x20;					
					sz[i++] = 0x20;	
					sz[i++] = 0x20;	
					strLen+=3;
					if(strLen>=2)
						temp_len = strLen -2;
					else
						break;
				}
				
			}
		}
#endif
			pfnKKUnicodeStrcat((S8*)(pBuilder->strBuf), (S8*)sz);
		}
		else //current string is NULL
		{
			pUI->MultiLineRdOnlyCategory = TRUE; //hexun,070326,进空的blog时无左右软键不能退出或出现死机
			return 0 ;
		}

		if(nextItemType == NEXT_ITEM_STRING_LF) {
			pfnKKUnicodeStrcat((S8*)(pBuilder->strBuf), STR_LINE_FEED);
			strLen += pfnKKUnicodeStrlen(STR_LINE_FEED);
		}

		if((nextItemType != NEXT_ITEM_STRING_CONT)
			&&(nextItemType != NEXT_ITEM_STRING_LF))
		{
			if((nextItemType == NEXT_ITEM_NULL) && (pUI->nControls == 0))
			{
				pUI->MultiLineRdOnlyCategory=TRUE;
			}
			else
			{
			}
			if(nextItemType == NEXT_ITEM_NULL)
			{
				nMaxLine = UI_MAX_LINE_NUM - pUI->totalLineNum; 
				if(nMaxLine <= 0) {
					nMaxLine = 2;
				}
			}
			else
			{
				//字符数较多的情况下显示为多行只读字串
				nMaxLine = (pfnKKUnicodeStrlen((S8 *)pBuilder->strBuf)/LINE_TEXT_NUM_MAX);
				if (nMaxLine >=1)
				{
					nMaxLine +=1;
				}
			}

			if(pUI->nCurBufLen % 2 != 0)
			{
				pUI->buffer[pUI->nCurBufLen] = 0x0;
				pUI->nCurBufLen++;
			}

			pUI->pStringText[pUI->nStringNum] = &(pUI->buffer[pUI->nCurBufLen]);
			pfnKKUnicodeStrcpy((S8*)(&(pUI->buffer[pUI->nCurBufLen])),(const S8*)(pBuilder->strBuf));
			pUI->stringTextLen[pUI->nStringNum] = pfnKKUnicodeStrlen((const S8*)(pBuilder->strBuf));
			pUI->nCurBufLen += pUI->stringTextLen[pUI->nStringNum];
			pUI->buffer[pUI->nCurBufLen] = 0x0;
			pUI->buffer[pUI->nCurBufLen+1] = 0x0;
			pUI->nCurBufLen += 2;
						
			pUI->ctrlStringIndex[pUI->nStringNum] = pUI->nControls;
			pUI->nStringLineNum[pUI->nStringNum] = nMaxLine;
			pUI->nStringNum ++;

			pUI->CtrlType[pUI->nControls] = CTL_STRING;
			pUI->bCanActive[pUI->nControls] = TRUE;
			pUI->nControls ++;
			pUI->totalLineNum+= (nMaxLine > 0)?nMaxLine : 1;

			//if(nextItemType == NEXT_ITEM_NULL)
			{
				for(i=0; i<(nMaxLine-1); i++)
				{
					// SetInlineItemCaption

					pUI->CtrlType[pUI->nControls] = CTL_SPACE;
					pUI->bCanActive[pUI->nControls] = FALSE;
					pUI->nControls ++;
// 					pUI->totalLineNum++;

 				}
			}
			DEV_MemSet(pBuilder->strBuf, 0x00, sizeof(pBuilder->strBuf));
 		}
	}
	return 0;
}//end UI_StrAdd()

