static bool_t  UI_CheckItemAdd(IBuilder * pIBuilder, int32_t nCheckId, int32_t index, byte_t * szTitle, int32_t nTitleLen, bool_t itemIsSelected)
{
	Builder * pBuilder = (Builder *)pIBuilder;
// 	DeviceData * pDd = (DeviceData *)pBuilder->pWep->pDeviceData;
	UI * pUI = pBuilder->pUI;

	if( (pUI != NULL)
		&&(pUI->nCheckboxNum > 0)
		&&(pUI->nCheckboxNum > nCheckId)
		&&(pUI->nCheckboxNum < UI_MAX_SUBITEM_NUM))
	{
		if(pUI->nCurBufLen % 2 != 0)
		{
			pUI->buffer[pUI->nCurBufLen] = 0x0;
			pUI->nCurBufLen++;
		}

		pUI->pCheckText[pUI->nCheckboxItem] = &(pUI->buffer[pUI->nCurBufLen]);
		pUI->checkTextLen[pUI->nCheckboxItem] = DEV_NetUniByte2LocStr(&(pUI->buffer[pUI->nCurBufLen]), szTitle, nTitleLen);
		pUI->nCurBufLen += MAX_SUBITEM_CAPTION_LEN;//在buffer中占用固定长度，因为其内容可以改变
		pUI->buffer[pUI->nCurBufLen] = 0x0;
		pUI->buffer[pUI->nCurBufLen+1] = 0x0;
		pUI->nCurBufLen += 2;

		pUI->bCanActive[pUI->nControls] = TRUE;
		pUI->CtrlType[pUI->nControls] = CTL_CHECKBOX;
		pUI->ctrlCheckItemIndex[pUI->nCheckboxItem] = pUI->nControls;
		pUI->checkBoxValue[pUI->nCheckboxItem] = itemIsSelected ? 1 : 0 ;
		pUI->indexIncheckBox[nCheckId]++;
		pUI->nCheckboxItem++;
		pUI->nControls++;
		
		return TRUE;
	}
	return FALSE;
}


