static bool_t UI_SoftKeyAdd(IBuilder * pIBuilder,int32_t softKeyID,	int32_t softKeyPos, byte_t * szTitle, int32_t nTitleLen)
{
	Builder * pBuilder = (Builder *)pIBuilder;
 	DeviceData * pDd = (DeviceData *)pBuilder->pWep->pDeviceData;
	UI * pUI = pBuilder->pUI;
	
	if(GetActiveScreenId() != pDd->screenId)
	{
		WM_DebugPrint(">>>>>>UI_SoftKeyRemove() GetActiveScreenId() != pDd->screenId");
	//	return FALSE;
	}

	if (pUI != NULL)
	{
		int32_t index;//james 070523
		DEV_NetUniByte2LocStr(pUI->uiSK[pUI->numOfSoftKey].softkeyTitle, szTitle, nTitleLen);
	#ifdef WEP_DEBUG
//		WM_DebugPrint("#UI_SoftKeyAdd()--1---- softKeyPos=%d",softKeyPos);
	#endif

		index =  ((softKeyPos == SKEY_POS_BACK) ? RIGHT_SOFTKEY_ID : LEFT_SOFTKEY_ID);
#ifdef WEP_DEBUG
//		WM_DebugPrint("#UI_SoftKeyAdd()--2-- softKeyPos=%d",index);
#endif
		if(pUI->numOfSoftKey==0)
		{
			pUI->uiSK[0].softkeyPos = 0;
			pUI->uiSK[1].softkeyPos = 0;
		}
		pUI->uiSK[pUI->numOfSoftKey].softkeyPos = index;
		pUI->uiSK[pUI->numOfSoftKey].softkeyId = softKeyID;
		
		pUI->numOfSoftKey++;

		return TRUE;
	}
#ifdef WEP_DEBUG
		WM_DebugPrint("!!!!!!!!!!!!!!!!!!!!! UI_SoftKeyAdd() error");
#endif

	return FALSE;
}//end UI_SoftKeyAdd()

////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////
static bool_t	UI_SoftKeyRemove(IUI * pIUI, int32_t softKeyID)
{
	UI * pUI = (UI *)pIUI;
      WEPAppData * pWep = pUI->pWep;//pp
	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);


	if(GetActiveScreenId() != pDd->screenId)
	{
		WM_DebugPrint(">>>>>>UI_SoftKeyRemove() GetActiveScreenId() != pDd->screenId");
		//return FALSE;
	}
	if (pUI != NULL)
	{
		int32_t i;

		//Add by YHB, 2007-04-12. {{{
		if(pUI->bKeepSoftkey)
			return FALSE;
		//Add by YHB, 2007-04-12. }}}

		//if(pUI->bOpenFullEditor)
			if(pWep->bOpenFullEditor)
		{ 
			pUI->numOfSoftKey = 0;
			return FALSE;
		}
		
		if (pUI->numOfSoftKey > 2)
		{
			pUI->numOfSoftKey = 2;
		}

		for(i=0;i<UI_MAX_SOFTKEY_NUM;i++)
		{
			if(pUI->uiSK[i].softkeyId == softKeyID)
			{
				pUI->uiSK[i].softkeyId = 0;
				if(pUI->uiSK[i].softkeyPos == RIGHT_SOFTKEY_ID)
				{
				//	clear_right_softkey();
				//	clear_right_softkey_handler();
					pUI->numOfSoftKey--;//Add by YHB, 2007-07-27.
				}
				else if (pUI->uiSK[i].softkeyPos == LEFT_SOFTKEY_ID)
				{
				//	clear_left_softkey();
				//	clear_left_softkey_handler();
					pUI->numOfSoftKey--;//Add by YHB, 2007-07-27.
				}
			}
		}

		return TRUE;
	}
	return FALSE;
} // end UI_SoftKeyRemove()

