	int32_t text_x, text_y, text_w, text_h;

	if (pUI->waitingMsgLen<=0)
		return;

	gdi_image_get_dimension(get_image(IMG_VIEWCHAT_WAITING), &img_w, &img_h);
	/*if(UI_device_height >= UI_device_width)     //BN10064 start
	{
		rec_w = UI_device_width *3 /4;
		rec_h = rec_w + 15;
	}
	else
	{
	       rec_h = UI_device_height*3 /4;
		rec_w = rec_h + 15;
	}                                                                    
	
	rec_x = (UI_device_width - rec_w)/2;
	rec_y = (UI_device_height - rec_h)/2;*/

	rec_w = MMI_pop_up_dialog_width;
	rec_h = MMI_pop_up_dialog_height;
	rec_x = MMI_pop_up_dialog_x;
	rec_y = MMI_pop_up_dialog_y;		//BN10064 end

	img_x = rec_x + (rec_w - img_w)/2;
	img_y = rec_y + (rec_h - img_h)/2 - 20;
	
	gui_measure_string((UI_string_type)pUI->pWaitingMsgText, &text_w, &text_h);
	text_x = rec_x + (rec_w - text_w)/2;
	text_y = img_y + img_h; //(img_x + img_h + rec_x + rec_h - text_h)/2;

//	gui_lock_double_buffer();
