	gui_draw_gradient_rounded_rectangle(rec_x, rec_y, rec_x+rec_w, rec_y+rec_h, gui_color(0, 0, 0), gui_color(255, 255, 255), 6);
	gdi_image_draw_animation(img_x, img_y, get_image(IMG_VIEWCHAT_WAITING), NULL);
	gui_set_font(&MMI_default_font);
	gui_move_text_cursor(text_x, text_y);
	gui_set_text_color(gui_color(0,0,0));
  	gui_print_text((UI_string_type)pUI->pWaitingMsgText);
	gui_BLT_double_buffer(0,0,UI_device_width-1,UI_device_height-1);
