static bool_t UI_PictureDataProcess(IBuilder * pIBuilder, byte_t buffer[], int32_t len)
{
	Builder * pBuilder = (Builder *)pIBuilder;
// 	UI * pUI = pBuilder->pUI;
	WEPAppData * pWep = pBuilder->pWep;
	DeviceData * pDd = (DeviceData *)(pWep->pDeviceData);
	
	int32_t i, /*j,*/offset = 0;
	int32_t numberOfImage;
	byte_t  picType;
	byte_t  picPurpose;
	byte_t  picIndex;
	byte_t  picNameSize;
	int32_t picSize;
	bool_t	retval = FALSE;

	/*S32*/INT32 size = 0;
	UI_character_type picName[MAX_FILENAME_LEN],fileName[MAX_FILENAME_LEN];
	FS_HANDLE	hFile;

	//Add by YHB, 2007-04-27 {{{
//	FS_DiskInfo DiskInfo;
//	S32 free_space = 0;
	//Add by YHB, 2007-04-27 }}}

	numberOfImage = buffer[offset++];
	if (numberOfImage <= 0)
	{
		return FALSE;
	}
	
	for(i=0;i<pBuilder->numOfPicture;i++)
	{
		if(pBuilder->stPicture[i].pszPicData != NULL)
		{
			DEV_Free(pBuilder->stPicture[i].pszPicData);
			pBuilder->stPicture[i].pszPicData = NULL;
		}
	}
	pBuilder->numOfPicture = 0;

	for(i=0;i<numberOfImage;i++)
	{
		DEV_MemSet(picName,0x0,MAX_FILENAME_LEN*sizeof(UI_character_type));
		DEV_MemSet(fileName,0x0,MAX_FILENAME_LEN*sizeof(UI_character_type));
		picType = buffer[offset++];	
		picPurpose = buffer[offset++];	
		picIndex = buffer[offset++];	
		picNameSize = buffer[offset++];	

		DEV_NetUniByte2LocStr(picName, buffer + offset, picNameSize);
		offset += picNameSize;

		picSize	= (int32_t)((buffer[offset] & 0xff)<<8 | (buffer[offset+1] & 0xff));
		offset += 2;
#ifdef WEP_DEBUG
WM_DebugPrint("UI_PictureDataProcess: pic data size = %d", picSize);
#endif

		switch(picPurpose)
		{
		case 0:	// icon: save as icon and display

			pfnKKAnsiiToUnicodeString((S8 *)fileName,WEP_RES_PATH);
			size = pfnKKUnicodeStrlen((S8 *)fileName);
// 			for(j=0;picName[j-1]!='\0';j++){
// 				fileName[size+j]= picName[j];
// 			}
			pfnKKUnicodeStrcat((S8 *)&fileName[size],(S8*)picName);
			//pfnKKAnsiiToUnicodeString((S8 *)&fileName[size],(S8*)picName);

			//Add by YHB, 2007-04-27. {{{
/*			FS_GetDiskInfo((const WCHAR *)&fileName, &DiskInfo, FS_DI_FREE_SPACE | FS_DI_BASIC_INFO);
			free_space = DiskInfo.FreeClusters * DiskInfo.SectorsPerCluster * DiskInfo.BytesPerSector;
			if (free_space <= picSize)
				return FALSE;*/
			//Add by YHB, 2007-04-27. }}}

			hFile = MMI_FS_Open((PU8)fileName, FS_READ_WRITE | FS_CREATE);
			if(hFile >= 0)
			{
				if(FS_NO_ERROR == MMI_FS_Write( hFile, buffer+offset,picSize, /*(uint32_t*)*/&size)) 
				{
					retval = TRUE;
				}
				MMI_FS_Close(hFile);
				if(retval) {
					pDd->imageIndex[picIndex] = ICON_NOT_LOAD;
				}
			}
			break;
		
		case 1:	// download: save only
			pfnKKAnsiiToUnicodeString((S8 *)fileName,WEP_DOWNLOAD_PATH);
			size = pfnKKUnicodeStrlen((S8 *)fileName);
// 			for(j=0;picName[j-1]!='\0';j++){
// 				fileName[size+j]= picName[j];
// 			}
			pfnKKUnicodeStrcat((S8 *)&fileName[size],(S8*)picName);
			//pfnKKAnsiiToUnicodeString((S8 *)&fileName[size],(S8*)picName);

			//Add by YHB, 2007-04-27. {{{
/*			FS_GetDiskInfo((const WCHAR *)&fileName, &DiskInfo, FS_DI_FREE_SPACE | FS_DI_BASIC_INFO);
			free_space = DiskInfo.FreeClusters * DiskInfo.SectorsPerCluster * DiskInfo.BytesPerSector;
			if (free_space <= picSize)
				return FALSE;*/
			//Add by YHB, 2007-04-27. }}}

			hFile = MMI_FS_Open((PU8)fileName, FS_READ_WRITE | FS_CREATE);
			if(hFile >= 0)
			{
				if(FS_NO_ERROR == MMI_FS_Write( hFile, buffer+offset,picSize, /*(uint32_t*)*/&size)) 
				{
					retval = TRUE;
				}
				MMI_FS_Close(hFile);
			}
			break;
		case 4:
//	DrawWepVideoImage(&buffer[offset],picSize);
			break;


		case 2:	// common: display only
		default:
			{
				UIPictureData * pstPic = &pBuilder->stPicture[picIndex];
/*
				pfnKKAnsiiToUnicodeString((S8 *)fileName,WEP_DOWNLOAD_PATH);
				size = pfnKKUnicodeStrlen((S8 *)fileName);
				pfnKKAnsiiToUnicodeString((S8 *)&fileName[size],(S8*)picName);
#ifdef WEP_DEBUG
	WM_DebugPrint("UI_PictureDataProcess: %s",&fileName[size]);
#endif

				hFile = FS_Open((PU16)fileName, FS_READ_WRITE | FS_CREATE);
				if(hFile >= 0)
				{
					if(FS_NO_ERROR == FS_Write( hFile, buffer+offset,picSize, (uint32_t*)&size)) 
					{
						retval = TRUE;
					}
					FS_Close(hFile);
				}	
*/				
				pstPic->pszPicData = (byte_t *)DEV_Malloc(MALLOC_MODULE_PICTURE_DATA + picIndex, picSize+CSD_IMAGE_HEADER_LEN);
				if(pstPic->pszPicData == NULL) {
					return FALSE;
				}
				switch(picType)
				{
					case PICTURE_FORMAT_PNG:
						pstPic->pszPicData[0] = IMAGE_TYPE_INVALID;
					break;
					case PICTURE_FORMAT_GIF:
						pstPic->pszPicData[0] = IMAGE_TYPE_GIF;
					break;
					case PICTURE_FORMAT_JPG:
						pstPic->pszPicData[0] = IMAGE_TYPE_JPG;
					break;
					case PICTURE_FORMAT_BMP:
						pstPic->pszPicData[0] = IMAGE_TYPE_BMP;
					break;
					case PICTURE_FORMAT_BREW_PNG:
						pstPic->pszPicData[0] = IMAGE_TYPE_INVALID;
					break;
					case PICTURE_FORMAT_ICO:
						pstPic->pszPicData[0] = IMAGE_TYPE_INVALID;
					break;
					default:
						pstPic->pszPicData[0] = IMAGE_TYPE_INVALID;
					break;
				}

				pstPic->pszPicData[1] = 0x0;
				pstPic->pszPicData[2] = LBYTE(picSize);
				pstPic->pszPicData[3] = HBYTE(picSize);
				pstPic->pszPicData[4] = 0x0;
				pstPic->pszPicData[5] = 0x0;
				pstPic->pszPicData[6] = 0x0;
				pstPic->pszPicData[7] = 0x0;

				DEV_MemCpy(pstPic->pszPicData+CSD_IMAGE_HEADER_LEN, buffer+offset, picSize);
				pstPic->lenOfPicData = picSize+CSD_IMAGE_HEADER_LEN;
				pstPic->pictureType = picType;

				pBuilder->numOfPicture++;
			}
			break;
		}

		offset += picSize;
	}

	return TRUE;
}//end UI_PictureDataProcess()

