//对以'/'开头的字符串进行匹配，匹配成功取得相应表情字符对应的图标索引
int32_t DEV_ChatFaceImageIdGet(IBuilder * pIBuilder,char *pStr,int32_t *pSymlen)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	int32_t i, faceLen;
	
	for(i=0;i<pBuilder->chatSymbolNum;i++)
	{
		faceLen = pfnKKUnicodeStrlen((const S8 *)pBuilder->chatFaceSymbol[i]);
		if(0 == DEV_MemCmp(pStr, pBuilder->chatFaceSymbol[i], faceLen))
		{
			if(pSymlen != NULL) {
				*pSymlen = faceLen;
			}
			return pBuilder->chatFaceImageId[i];
		}
	}
	return -1;	// not found
}


