////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////
//use for Animation such as 送礼啦
//可以直接保存在内存里（pBuilder->stPicture）也可以保存在文件里
static bool_t UI_ChatAnimationAdd(IBuilder * pIBuilder,byte_t buffer[], int32_t len)
{
	Builder * pBuilder = (Builder *)pIBuilder;
	UI * pUI = pBuilder->pUI;
	WEPAppData * pWep = pBuilder->pWep;

	int32_t offset = 0;
	int32_t numberOfAnimations;
	int32_t aniPicSize;
	byte_t  animationIndex;
	byte_t	aniPicType;

	S32 size = 0;
	WCHAR_t fileName[MAX_FILENAME_LEN];
	FS_HANDLE	hFile;

	DEV_TimerStop(pWep->pDeviceData, TIMER_ANIMATION);

	numberOfAnimations = buffer[offset++];//动画图片张数
  if (numberOfAnimations <= 0) {
		return FALSE;
  }
	animationIndex				= buffer[offset++];//动画图片索引
	aniPicType						=	buffer[offset++];//动画图片类型
	pUI->aniFrameWidth		=	buffer[offset++];//动画图片宽度
	pUI->aniFrameHeight		=	buffer[offset++];//动画图片高度
	pUI->aniFrameTotalNum = buffer[offset++];//动画图片总帧数
	
	DEV_MemCpy(pUI->aniFrameSeq	,buffer+offset, (pUI->aniFrameTotalNum));//动画图片帧播放序列
	offset += pUI->aniFrameTotalNum;
	aniPicSize = (int32_t)((buffer[offset] & 0xff)<<8 | (buffer[offset+1] & 0xff));//动画图片大小
	offset += 2;

	pfnKKAnsiiToUnicodeString((S8 *)fileName,"WEP_ani.gif");//任意指定一个名字

	hFile = MMI_FS_Open(fileName, FS_READ_WRITE | FS_CREATE);
	if(hFile >= 0)
	{
		if(FS_NO_ERROR == MMI_FS_Write( hFile, buffer+offset,aniPicSize , (uint32_t*)&size)) 
		{
			return TRUE;
		}
		MMI_FS_Close(hFile);

	}
	return FALSE;
}
