void UI_GetSystemThemes( void )
{
	fixed_icontext_menuitem *m;
	
	//list
	m = (fixed_icontext_menuitem*) MMI_fixed_list_menu.common_item_data;
	if(m){
		DEV_MemCpy(&(system_themes_save.sys_list), m, sizeof(fixed_icontext_menuitem));
		system_themes_save.sys_list_valid = TRUE;
	}else{
		system_themes_save.sys_list_valid = FALSE;
	}


	//title
	system_themes_save.sys_window_title_theme = current_window_title_theme;

	//rd only	
	system_themes_save.sys_multi_line_input_box_theme = current_multi_line_input_box_theme;

	//softkey
	DEV_MemCpy(&(system_themes_save.sys_mmi_softkeys[MMI_LEFT_SOFTKEY]), &(MMI_softkeys[MMI_LEFT_SOFTKEY]), sizeof(icontext_button));
#ifdef __MMI_WGUI_CSK_ENABLE__	
	DEV_MemCpy(&(system_themes_save.sys_mmi_softkeys[MMI_CENTER_SOFTKEY]), &(MMI_softkeys[MMI_CENTER_SOFTKEY]), sizeof(icontext_button));
#endif 
	DEV_MemCpy(&(system_themes_save.sys_mmi_softkeys[MMI_RIGHT_SOFTKEY]), &(MMI_softkeys[MMI_RIGHT_SOFTKEY]), sizeof(icontext_button));


}

void UI_RestoreSystemThemes( void )
{
	fixed_icontext_menuitem *m;
	
	//list
	if(system_themes_save.sys_list_valid){
	m = (fixed_icontext_menuitem*) MMI_fixed_list_menu.common_item_data;
	DEV_MemCpy(m, &(system_themes_save.sys_list), sizeof(fixed_icontext_menuitem));
	}


	//title
	current_window_title_theme = system_themes_save.sys_window_title_theme;

	//rd only	
	current_multi_line_input_box_theme = system_themes_save.sys_multi_line_input_box_theme;

	//softkey
	DEV_MemCpy( &(MMI_softkeys[MMI_LEFT_SOFTKEY]), &(system_themes_save.sys_mmi_softkeys[MMI_LEFT_SOFTKEY]), sizeof(icontext_button));
#ifdef __MMI_WGUI_CSK_ENABLE__	
	DEV_MemCpy( &(MMI_softkeys[MMI_CENTER_SOFTKEY]), &(system_themes_save.sys_mmi_softkeys[MMI_CENTER_SOFTKEY]), sizeof(icontext_button));
#endif 
	DEV_MemCpy( &(MMI_softkeys[MMI_RIGHT_SOFTKEY]), &(system_themes_save.sys_mmi_softkeys[MMI_RIGHT_SOFTKEY]),  sizeof(icontext_button));


}
